  true,\n\t\"url\": null,\n\t\"notes\": \"Estimates of watershed (12-digit huc) impervious
  cover and impervious cover near streams and water body shorelines for three dates
  (2001, 2006, 2011) using NLCD data.  Differences between watershed impervious cover
  and impervious cover near streams can be used to assess the spatial pattern of impervious
  cover within a watershed.nnThis dataset is associated with the following publication:nWickham
  , J., A. Neale , M. Mehaffey , T. Jarnagin , and D. Norton. Temporal Trends in Impervious
  Cover Relative to Stream Location..   JOURNAL OF AMERICAN WATER RESOURCES ASSOCIATION.
  American Water Resources Association, Middleburg, VA, USA, 52(2): 409-419, (2016).\",\n\t\"license_title\":
